/*
    Project : AddMustard
    Author(s) : David Charles
*/

//dependancies
import { Link } from "react-router-dom";

//styles
import "./ImageContainer.scss";



export default function ImageContainer(props) {
    //properties
    const imageSource = props.componentData.imageSource; //string
    const imageAlt = props.componentData.imageAlt; //string
    const imageHrefType = props.componentData.imageHrefType; //string
    const imageHref = props.componentData.imageHref; //string

    //functions
    const generateImage = () => {
        if (imageHref) {
            if (imageHrefType === "internalLink") {
                return (
                    <Link to={imageHref}>
                        <img src={imageSource} alt={imageAlt} />
                    </Link>
                )

            } else if (imageHrefType === "externalLink") {
                return (
                    <a href={imageHref}>
                        <img src={imageSource} alt={imageAlt} />
                    </a>
                )
            } else {
                return (
                    <img src={imageSource} alt={imageAlt} />
                )
            }

        } else {
            return (
                <img src={imageSource} alt={imageAlt} />
            )
        }
    }

    return (
        <div className="ImageContainer">
            <div className="inner">
                {generateImage()}
            </div>
        </div>
    );
}
